Merges the files in the `array` directory to `array.d.ts`, etc, using a script:
```js
// @ts-check

const assert = require("assert");
const fs = require("fs");
const path = require("path");

const prefix = `import _ = require("../index");
declare module "../index" {
`;
const suffix = "\n}";

// This file is just a comment...
fs.unlinkSync("seq/prototype.at.d.ts");

for (const dir of ["array", "collection", "date", "function", "lang", "math", "number", "object", "seq", "string", "util"]) {
    const files = fs.readdirSync(dir).map(f => path.join(dir, f));
    const combined = getCombinedText(dir, files);
    for (const file of files)
        fs.unlinkSync(file);
    fs.rmdirSync(dir);
    fs.writeFileSync(path.join("common", dir + ".d.ts"), combined);
}

/**
 * @param {string} dir
 * @param {string[]} files
 * @return {string}
 */
function getCombinedText(dir, files) {
    const inners = files.map(file => {
        let text = fs.readFileSync(file, "utf-8");
        if (!text.endsWith(suffix)) {
            text = text.slice(0, text.length - 1);
        }
        assert(file.endsWith(".d.ts"));
        const name = withoutStartEnd(file, `${dir}/`, ".d.ts");
        return `    // ${name}\n\n${withoutStartEnd(text, prefix, suffix)}`;
    });

    return prefix + inners.join("\n\n") + suffix;
}

/**
 * @param {string} s
 * @param {string} start
 * @param {string} end
 * @return {string}
 */
function withoutStartEnd(s, start, end) {
    assert(s.startsWith(start) && s.endsWith(end));
    return s.slice(start.length, s.length - end.length);
}
```

